import React from "react";
import "./Root.css";

const picture =
  "https://upload.wikimedia.org/wikipedia/commons/b/bf/Pig_farm_Vampula_9.jpg";
const alt = "Picture of a pig";

const content = `Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore \
et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea \
commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla \
pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est \
laborum.`;

function Root() {
  return (
    <div>
      <header>Nicolas Bonnet</header>
      <nav>
        <button>Home</button>
        <button>Search</button>
      </nav>
      <div className={"flex-container"}>
        <aside>
          <img src={picture} alt={alt} />
        </aside>
        <section>{content}</section>
      </div>
    </div>
  );
}

export default Root;
